(window.webpackJsonp=window.webpackJsonp||[]).push([[1],{198:function(t,n){t.exports='<h3 id="注册">注册</h3>\n<pre><code class="language-javascript">import &#39;happy-mobile/dist/button/button&#39;</code></pre>\n<h3 id="基本使用">基本使用</h3>\n<pre><code class="language-html">&lt;h-button&gt;Button&lt;/h-button&gt;</code></pre>\n<h3 id="颜色-color">颜色 Color</h3>\n<p>支持<code>primary</code>、<code>white</code>、<code>green</code>、<code>yellow</code> <code>error</code> 默认为<code>primary</code></p>\n<pre><code class="language-html">&lt;h-button color=&quot;primary&quot;&gt;primary&lt;/h-button&gt;\n&lt;h-button color=&quot;white&quot;&gt;white&lt;/h-button&gt;\n&lt;h-button color=&quot;green&quot;&gt;green&lt;/h-button&gt;\n&lt;h-button color=&quot;yellow&quot;&gt;yellow&lt;/h-button&gt;\n&lt;h-button color=&quot;red&quot;&gt;red&lt;/h-button&gt;</code></pre>\n<h3 id="内联-inline">内联 Inline</h3>\n<pre><code class="language-html">&lt;h-button inline&gt;inline&lt;/h-button&gt;</code></pre>\n<h3 id="阴影-shadow">阴影 Shadow</h3>\n<pre><code class="language-html">&lt;h-button shadow&gt;shadow&lt;/h-button&gt;</code></pre>\n<h3 id="边框-outline">边框 Outline</h3>\n<pre><code class="language-html">&lt;h-button outline inline&gt;outline&lt;/h-button&gt;\n&lt;h-button outline color=&quot;white&quot; inline&gt;outline&lt;/h-button&gt;\n&lt;h-button outline color=&quot;green&quot; inline&gt;outline&lt;/h-button&gt;\n&lt;h-button outline color=&quot;error&quot; inline&gt;outline&lt;/h-button&gt;</code></pre>\n<h3 id="大小-size">大小 Size</h3>\n<pre><code class="language-html">&lt;h-button size=&quot;small&quot; shadow inline&gt;小 small&lt;/h-button&gt;\n&lt;h-button size=&quot;medium&quot; shadow inline&gt;中 medium&lt;/h-button&gt;\n&lt;h-button size=&quot;large&quot; shadow inline&gt;大 large&lt;/h-button&gt;</code></pre>\n<h3 id="禁用-disabled">禁用 Disabled</h3>\n<p> disabled为true时，用户无法click</p>\n<pre><code class="language-html">&lt;h-button disabled inline&gt;禁用&lt;/h-button&gt;\n&lt;h-button disabled color=&quot;white&quot; inline&gt;white&lt;/h-button&gt;\n&lt;h-button disabled color=&quot;green&quot; inline&gt;green&lt;/h-button&gt;\n&lt;h-button disabled color=&quot;error&quot; inline&gt;error&lt;/h-button&gt;</code></pre>\n<h3 id="加载-loading">加载 Loading</h3>\n<p>Loading时，disabled为true</p>\n<pre><code class="language-html">&lt;h-button loading&gt;Loading&lt;/h-button&gt;\n&lt;h-button id=&quot;h-loading&quot;&gt;Loading&lt;/h-button&gt;</code></pre>\n<pre><code class="language-javascript">// JavaScript\nconst loadingButton = document.querySelector(&#39;#h-loading&#39;);\nloadingButton.addEventListener(&#39;click&#39;, () =&gt; {\n  loadingButton.loading = true;\n  setTimeout(() =&gt; { loadingButton.loading = false }, 1000);\n})</code></pre>\n<h3 id="图标按钮">图标按钮</h3>\n<p>需要使用搭配<a href="#icon">h-icon</a>使用</p>\n<pre><code class="language-html">&lt;!-- css --&gt;\n&lt;style&gt; h-button &gt; h-icon+span{ margin-left: 4px; } &lt;/style&gt;\n\n&lt;!-- html --&gt;\n&lt;h-button size=&quot;small&quot; color=&quot;white&quot; inline&gt;\n    &lt;h-icon type=&quot;check-circle&quot;&gt;&lt;/h-icon&gt;\n    &lt;span&gt;Icon&lt;/span&gt;\n&lt;/h-button&gt;\n&lt;h-button size=&quot;medium&quot; color=&quot;yellow&quot; inline&gt;\n    &lt;h-icon type=&quot;check-circle&quot;&gt;&lt;/h-icon&gt;\n    &lt;span&gt;Icon&lt;/span&gt;\n&lt;/h-button&gt;\n&lt;h-button size=&quot;large&quot; color=&quot;red&quot; inline&gt;\n    &lt;h-icon type=&quot;check-circle&quot;&gt;&lt;/h-icon&gt;\n    &lt;span&gt;Icon&lt;/span&gt;\n&lt;/h-button&gt;</code></pre>\n<h3 id="属性-attribute">属性 attribute</h3>\n<table>\n<thead>\n<tr>\n<th>属性名</th>\n<th>类型</th>\n<th>默认值</th>\n<th>说明</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>color</td>\n<td>string</td>\n<td><code>primary</code></td>\n<td>按钮颜色，可选值为<code>primary</code> <code>white</code> <code>green</code> <code>yellow</code> <code>error</code></td>\n</tr>\n<tr>\n<td>size</td>\n<td>string</td>\n<td><code>medium</code></td>\n<td>按钮大小，可选值为<code>medium</code> <code>small</code> <code>large</code></td>\n</tr>\n<tr>\n<td>loading</td>\n<td>boolean</td>\n<td><code>false</code></td>\n<td>加载状态</td>\n</tr>\n<tr>\n<td>outline</td>\n<td>boolean</td>\n<td><code>false</code></td>\n<td>镂空button</td>\n</tr>\n<tr>\n<td>shadow</td>\n<td>boolean</td>\n<td><code>false</code></td>\n<td>阴影</td>\n</tr>\n<tr>\n<td>inline</td>\n<td>boolean</td>\n<td><code>false</code></td>\n<td>内联Button</td>\n</tr>\n<tr>\n<td>type</td>\n<td>string</td>\n<td><code>button</code> <code>submit</code> <code>reset</code></td>\n<td>原生Button的type</td>\n</tr>\n</tbody></table>\n<h3 id="方法-method">方法 method</h3>\n<table>\n<thead>\n<tr>\n<th>方法名</th>\n<th>返回值</th>\n<th>说明</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>showLoading</td>\n<td><code>hideLoading</code></td>\n<td>显示加载状态</td>\n</tr>\n<tr>\n<td>hideLoading</td>\n<td><code>void</code></td>\n<td>隐藏加载状态</td>\n</tr>\n</tbody></table>\n'}}]);